// src/Navbar.js
import React from "react";
import company from "./company.svg";
import home from "./home.svg";
import about from "./about.svg";
import phone from "./phone.svg";
import "./Navbar.css";

function Navbar() {
  return (
    <div className="navbar">
      <div className="logo">
        <img src={company} />
      </div>
      <div className="search-bar">
        {/* Your search bar component goes here */}
      </div>
      {/* <div className="icons"> */}
        <div className="icon">
          <img src={home} alt="Home Icon" />
          <div className="home">Home</div>
        </div>

        <div className="icon">
          <img src={phone} alt="Contact Icon" />
          <div className="names">Contact</div>
        </div>
        <div >
          <img src={about} className="icon" alt="About Icon" />
          <div className="names">about</div>
        </div>

        <div className="icon">
          <img src={home} alt="Home Icon" />
          <div className="home">Home</div>
        </div>

        <div className="icon">
          <img src={phone} alt="Contact Icon" />
          <div className="names">Contact</div>
        </div>
        <div className="icon">
          <img src={about} alt="About Icon" />
          <div className="names">about</div>
        </div>
      </div>
    // </div>
  );
}

export default Navbar;
